import React from "react";
import "./Footer.css"
function Footer(){
    const messageOnFooter="This is the Footer!";
    const date=new Date()
    return(

        <div>
            <h1 style={{color:"blue",backgroundColor:"orange"}}>{messageOnFooter}</h1>
            <h1 className="foot">The time is:{date.getHours()+"::"+date.getMinutes()}</h1>
        </div>
    )
}

export default Footer;
